import React from 'react';
import { connect } from 'react-redux'

class Makes extends React.Component {
    render() {
        return (
            <div>
                {this.props.makes.makes.map(make => (
                    <option onClick={this.props.handleMakeChange} key={make.id} value={make.name}> {make.name} </option>
                ))}
            </div>
        )
    }
}

export default connect(state => state)(Makes);
